--
-- 1. SECTORES
--

UPDATE geo.tg_sectores
SET geom = ST_MakePolygon(ST_LineMerge(geom1)),
area_grafi = st_area(ST_MakePolygon(ST_LineMerge(geom1)))
WHERE ST_IsClosed(ST_LineMerge(geom1)) = true;

ALTER TABLE IF EXISTS geo.tg_sectores DROP COLUMN IF EXISTS geom1;
